import './Navbar.css';
import { FaDollarSign, FaShoppingCart, icons } from "react-icons/fa";
import {Link} from "react-router-dom";

function Navbar() {
  
  return (

    <div className="navbar">
      <nav className='items'>
          <div className='link'>
            <Link to='/'>Women</Link>
          </div>
          <div className='link'>
            <Link to='/Men'>Men</Link>
          </div>
          <div className='link'>
            <Link to='/'>Kids</Link>
          </div>
         </nav>
    </div>

  );
}

export default Navbar;


<span className='Fad'>
<FaDollarSign />
<FaShoppingCart />
</span>
